import React, { useState, useEffect } from "react";
import axios from "axios";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";

export default function WorkoutDetail() {
  const [workouts, setWorkouts] = useState([]);

  const getWorkouts = async () => {
    const response = await axios.get("http://localhost:8000/api/workouts");
    setWorkouts(response.data);
  };

  useEffect(() => {
    getWorkouts();
  }, []);

  return (
    <div>
      <h1>Workouts</h1>
      {workouts.map((workout, index) => (
        <Card
          className="m-2 rounded shadow-lg workouts-card-info"
          style={{ width: "18rem" }}
        >
          <Card.Body>
            <Card.Title>{workout.type}</Card.Title>
            <Card.Subtitle className="mb-2 text-muted">
              {workout.location}
            </Card.Subtitle>
            <Card.Subtitle className="mb-2 text-muted">
              {workout.date}
            </Card.Subtitle>
            <Card.Text>{workout.completed}</Card.Text>
            <Card.Text>{workout.workout_length}</Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
      ))}
    </div>
  );
}

